from itertools import count, islice
def ok(n, prevset):
    b = bin(n)[2:]
    if n%b.count("1"): return False
    si = (b[:i]+b[i+1:] for i in range(len(b)))
    return any(t[0] != '0' and int(t, 2) in prevset for t in si)
def agen(): # generator of terms
    s, snxt = {1}, set()
    for n in count(2):
        yield len(s)
        for i in range(2**(n-1), 2**n):
            if ok(i, s):
                snxt.add(i)
        s, snxt = snxt, set()
